import WorkerList from "./pages/workers/WorkersList";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/projects" element={<ProjectList />} />
        <Route path="/workers" element={<WorkerList />} />
      </Routes>
    </Router>
  );
}

export default App;
